import React from 'react';
import "../Navbar.css"; // Import your CSS file

const Navbar = () => {
  return (
    <div id="appleNav">
      <ul>
        {/* Projects */}
        <div className="pfp">
        <img
          src={"./images/login.png"}
          alt="Me, Omer"
          style={{
            width: "10%",
            height: "10%",
            borderRadius: "50%",
            objectFit: "cover",
          }}
        />
      </div>
        <li>
          <a href="#projects">
            Projects
          </a>
        </li>

        {/* Garage */}
        <li>
          <a href="#garage">
            <p>Garage</p>
          </a>
        </li>

        {/* Contact */}
        <li>
          <a href="#contact">
            Contact
          </a>
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
